import React, { useEffect, useState } from "react";
import { useFetcher } from "react-router-dom";

export default function CustomHooks() {
    useFetcher
  const [data, setData] = useState(""); // Move useState here

  useEffect(() => {
    fetch("https://fakestoreapi.com/products")
      .then((response) => response.json()) // Extract JSON data
      .then((response) => {
        setData(response); // Set data
      })
      .catch((error) => {
        console.error("Error fetching data:", error); // Handle errors
      });
  }, []); // Run only once

  return (
    <>
      {data.length > 0 ? JSON.stringify(data) : alert("API error")}
      <div>Custom Hooks Component</div> {/* Render component */}
    </>
  );
}
